import './App.css';
import Player from './Player';
import User from './User';

function App() {
  return (
    <div className="App">
      <h1>One Jam</h1>
      <div className="spotify-container"
      style={{width:"80%", margin: "auto"}}
      >
        <div className="main-player" style={{wdith: "300px"}}>
          <Player/>
        </div>

      </div>
      <div className="user-container">
        <h2>
          Users
        </h2>
        <User/>

      </div>
    </div>
  );
}

export default App;
